import React from "react";
import NavBar from "./NavBar";
import Banner from "./Banner";
import MovieDetail from "./Menu/MovieDetail";
function Browse() {
  const detailHandler = (props) => {};
  return (
    <div>
      <NavBar />
      <Banner />
      <MovieDetail dataDetail={detailHandler} />
    </div>
  );
}

export default Browse;
